css:
atom-text-editor,
:host {
  background: radial-gradient(ellipse at center, #000000 0%, #001000 90%);
  color: #00e000;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #003400;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #002200;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #003400;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #001100;
  color: #00e000;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #002200;
  color: #00ff00;
  text-shadow: 0px 0px 5px rgba(0, 255, 0, 0.5);
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #00ff00;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #008c00;
}
atom-text-editor .invisible,
:host .invisible {
  color: #00e000;
}
atom-text-editor .cursor,
:host .cursor {
  color: #00ff00;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #036303;
  background: repeating-linear-gradient(0deg, #000000, #000000 1px, #036303 2px, #036303 1px);
  border-right: 2px solid #005600;
  border-left: 2px solid #005600;
}
atom-text-editor .line.cursor-line,
:host .line.cursor-line {
  background: linear-gradient(to bottom, rgba(32, 255, 12, 0.02), transparent, rgba(12, 255, 0, 0.02));
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #008c00 !important;
}
atom-text-editor::shadow .find-result .region {
  background-color: transparent;
  border: none;
  outline: 1px solid #008c00;
  outline-offset: 1px;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #003400;
}
.comment {
  color: #008c00;
}
.bold {
  font-weight: bold;
}
.italic {
  font-style: italic;
}
.underline {
  text-decoration: underline;
}
.entity.name.type {
  color: #00ff00;
  text-shadow: 0px 0px 5px rgba(0, 255, 193, 0.8);
}
.entity.other.inherited-class {
  color: #00e000;
}
.storage.keyword.control,
.type.keyword.control,
.storage,
.type {
  color: #ffffff;
}
.storage.function,
.type.function,
.storage.class,
.type.class {
  text-shadow: 0px 0px 5px rgba(127, 255, 193, 0.66);
}
.keyword {
  color: #ffffff;
  text-shadow: 0px 0px 5px rgba(0, 255, 193, 0.5);
}
.keyword.control,
.keyword.storage,
.keyword.type {
  font-style: italic;
}
.keyword.control,
.keyword.storage.var,
.keyword.storage.const {
  text-shadow: none;
}
.keyword.operator {
  color: #cccccc;
}
.keyword.key {
  color: #00ff76;
}
.keyword.class:not(.storage) {
  color: #02ff63;
}
.keyword.other.special-method {
  color: #00e000;
}
.keyword.other.unit {
  color: #00e000;
}
.constant {
  color: #00e09d;
}
.constant.character.escape {
  color: #89de00;
}
.constant.numeric {
  color: #08ed8d;
}
.constant.other.color {
  color: #00e09d;
}
.constant.other.symbol {
  color: #00e09d;
}
.variable {
  color: #00ff33;
  border-bottom: 1px dashed #003400;
}
.variable.interpolation {
  color: #00ad00;
}
.variable.parameter.function {
  color: #00e000;
}
.invalid.illegal {
  background-color: #ff0000;
  color: #000000;
}
.string {
  color: #89de00;
  text-shadow: 0px 5px 5px rgba(100, 255, 100, 0.2);
}
.string.regexp {
  color: #89de00;
}
.string.regexp .source.ruby.embedded {
  color: #89de00;
}
.string.other.link {
  color: #89de00;
}
.punctuation.definition.comment {
  color: #006f00;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #00e000;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #83ff83;
}
.punctuation.definition.bold {
  color: #83ff83;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #83ff83;
}
.punctuation.section.embedded {
  color: #00ad00;
}
.support.class {
  color: #00ff00;
  font-weight: 400;
  text-shadow: 0px 0px 7px rgba(150, 255, 150, 0.7);
}
.support.function {
  color: #00ff00;
  text-shadow: 0px 0px 7px rgba(150, 255, 150, 0.7);
}
.support.function.any-method {
  color: #00ff00;
  text-shadow: 0px 0px 7px rgba(150, 255, 150, 0.7);
}
.entity.name.function {
  color: #83ff83;
}
.entity.name.class,
.entity.name.type.class {
  color: #83ff83;
}
.entity.name.section {
  color: #83ff83;
}
.entity.name.tag {
  color: #83ff83;
}
.entity.other.attribute-name {
  color: #00ff11;
}
.entity.other.attribute-name.id {
  color: #83ff83;
}
.meta.class {
  color: #00ff11;
}
.meta.link {
  color: #00ff11;
}
.meta.require {
  color: #00ff11;
}
.meta.selector {
  color: #00ff11;
}
.meta.separator {
  background-color: #000000;
  color: #00e000;
}
.meta.function-call {
  color: #00e09d;
}
.none {
  color: #00e000;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
  background-color: #000000;
}
.css.keyword.control {
  color: #ffff00;
}
.css.pseudo-class {
  color: #cccccc !important;
}
.text:not(.tag).xml,
.text:not(.tag).html,
.text:not(.tag).php {
  color: #ffffff;
}
.js.property,
.coffee.property {
  color: #82ff72;
}
.js.parameter,
.coffee.parameter {
  color: #00e09d !important;
  font-style: italic;
}
.gfm {
  -webkit-font-smooting: auto;
}
.gfm.heading {
  color: #ffffff;
  text-shadow: 1px 1px 0px rgba(0, 255, 0, 0.5);
}
.gfm.changed {
  color: #00ff00;
}
.gfm.deleted {
  color: #008c00;
}
.gfm.inserted {
  color: #83ff83;
}
.gfm.list {
  color: #00e000;
}
.gfm.quote {
  color: #008c00;
}
.gfm.raw.inline {
  color: #008c00;
}
.gfm.support {
  text-shadow: 0px 0px 1px rgba(100, 255, 185, 0.75);
}
